import React from "react";
import Nav from "../components/nav/nav";


function KanBan (){

    const TestA = () => {
        return(
            <div>
                <h1>A</h1>
            </div>
        )
    }

    const TestB = () => {
        return(
            <div>
                <h1>B</h1>
            </div>
        )
    }

    return(
        <>  
        <Nav compA={<TestA/>} compB={<TestB/>} leftButton={"+ column"} rightButton={"settings"} navHeader={"board's name"}/>
            <h1>IS UP</h1>
        </>
    )
}

export default KanBan
